import { UploadOutlined } from "@ant-design/icons";
import { Button, Upload } from "antd";
import Input from "antd/es/input/Input";
import TextArea from "antd/es/input/TextArea";
import React from "react";
import "../../App.css";

function Befehl() {
	return (
		<div className="BefehlInputContainer">
			<div className="BefehlInputSection">
				<TextArea placeholder="Input RISC-V Commands"></TextArea>
				<Button icon={<UploadOutlined />}>Upload RISC-V Commands</Button>
			</div>
			<div>
				<Upload multiple={false}>
					<Button icon={<UploadOutlined />}>Upload Assembly files (.s)</Button>
				</Upload>
			</div>
		</div>
	)
}

export default Befehl;
